import React, { useState } from "react";
import {
  Body,
  Container,
  Input,
  ContainerInput,
  ContainerButton,
  Button,
  TextLogin,
  Text,
} from "../styled/SignUp";

export default function SignInPage() {
  const [userName, setUserName] = useState();
  const [password, setPassword] = useState();

  return (
    <Container>
      <Body>
        <ContainerInput>
          <Input
            placeholder="Usuario"
            type="text"
            value={userName}
            onChange={(e) => setUserName(e.target.value)}
          />
          <Input
            placeholder="Senha"
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </ContainerInput>
        <ContainerButton>
          <TextLogin>
            Nao possui conta ? <Text to="/signup">Cadastrar</Text>
          </TextLogin>
          <Button>Entrar</Button>
        </ContainerButton>
      </Body>
    </Container>
  );
}
